import React from 'react'

const MealPlanResults = ({meals}) => {

    const mealsList = meals.map(meal => {
        // const imgSrc = ...meal.image
        return (
        <div className="MealResultContainer" key={meal.id}>
            <img src={meal.image[0]} alt={meal.title} />
            <h3>{meal.title}</h3>
        </div>
        )
    });
    
        return (
            <>
                { mealsList }
            </>
        );
}

export default MealPlanResults
